function Card({ onCardClick,  card: { name, link, likes }}) {
    function handleClick() {
        onCardClick(link);
      }
    return(
        <li class="element">
        <img class="element__image" src={link}
          alt={name} onClick={() => handleClick()} />
        <button class="element__delete"></button>
        <div class="element__name">
            <h2 class="element__text">{name}</h2>
            <button class="element__button" type="button"></button>
            <span class="element__like-sum">{likes.length}</span>
        </div>
    </li>
    )
}
